    ["40008"]=setmetatable({id=40008,type=7,picture="UI_bg_C01_n_wendelandechengneibaitian",titleNum="CN-1",titleBig="跌落兔子洞",title="温德兰德",tips="坐落在维涅尔谷地的两大聚居地之一，十数年前开始搭建巨大的帆，令异生体无法靠近。"},mt),
    ["40009"]=setmetatable({id=40009,type=7,picture="UI_bg_C01_n_wendelandechengneibaitian",titleNum="CN-2",titleBig="午夜为止的魔法",title="尘雾街",tips="温德兰德的贫民区，居民大多是没有稳定工作的流浪者或拾荒人，治安混乱，基本没有秩序可言，因此也没有搭建“帆”的能力，只是简单的用破布遮盖聊以慰藉。"},mt),
    ["40010"]=setmetatable({id=40010,type=7,picture="UI_bg_S_naina_naidelande",titleNum="CN-3",titleBig="红心审判庭",title="“奈德兰德”",tips="奈纳内心构建出的独属于她的城市。"},mt),
    ["40011"]=setmetatable({id=40011,type=7,picture="UI_bg_S_naina_naidelande",titleNum="CN-4",titleBig="三日，化为泡沫",title="“奈德兰德”-警报",tips="曾经的温德兰德也拥有这类警报，近年逐渐废弃。异常刺耳的声音令人极度烦躁，幼年的奈纳对其有着心理阴影。"},mt),
    ["40012"]=setmetatable({id=40012,type=7,picture="UI_bg_S_naina_naidelande",titleNum="CN-5",titleBig="不能开启的门",title="奈纳的房间",tips="奈纳的房间异常狭窄破旧，但她非常喜欢，以至于就算到了尼伯赞歌号上，她的房间依旧是同一个风格。"},mt),
    ["40013"]=setmetatable({id=40013,type=7,picture="UI_bg_S_naina_naidelande",titleNum="CN-6",titleBig="雪人易融",title="女王与40骑士",tips="或许是从某本并不正规的童话书中看到的故事。"},mt),
    ["40014"]=setmetatable({id=40014,type=7,picture="UI_bg_S_naina_naidelande",titleNum="CN-7",titleBig="锡兵不会融化",title="童话书",tips="幼年奈纳从垃圾堆里翻出的绘本童话书，早就不知道丢到哪里去了。"},mt),
    ["40015"]=setmetatable({id=40015,type=7,picture="UI_bg_S_naina_naidelande",titleNum="CN-8",titleBig="银鞋子与三步归乡",title="荣誉奖章",tips="REVO会为斯露德们颁发不同的荣誉奖章作为奖励，其类型有几十种。"},mt),
    ["40016"]=setmetatable({id=40016,type=7,picture="UI_bg_S_naina_naidelande",titleNum="CN-9",titleBig="幻梦不熄",title="波伽兰德的贸易街",tips="位于波伽兰德最主要干道的商贸街，道路错综复杂，许多波伽兰德人会在这里出售琳琅满目的商品。"},mt),
    ["40017"]=setmetatable({id=40017,type=7,picture="UI_jiazai_zhandou34",titleNum="10",titleBig="我永远相信你"},mt),
    ["40018"]=setmetatable({id=40018,type=7,picture="UI_jiazai_zhandou34",titleNum="1",titleBig="不要相信我"},mt),
    ["40019"]=setmetatable({id=40019,type=7,picture="UI_bg_C05_xuedi",titleNum="CX-1",titleBig="出人意料的谱号",title="拉普兰雪原",tips="斯露德小队唤冬号角的主要活动地区。以雪原为主的大片区域，占据了霍恩斯·特兰迪尔几乎百分之五十的区域。"},mt),
    ["40020"]=setmetatable({id=40020,type=7,picture="UI_bg_C05_xuedi",titleNum="CX-2",titleBig="4/4全力以赴",title="维涅尔谷地·Ⅰ",tips="谷地两侧的山峦为聚居地提供了良好的屏障。"},mt),
