    ["40172"]=setmetatable({id=40172,type=7,picture="UI_jiazai_zhandou21",titleNum="2",titleBig="移动指引",title="移动之道",tips="灵活掌握多种移动手段，有助于在战场上持续生存。大部分攻击都能通过移动进行回避，而当遇到强敌时，消耗体力，灵活使用闪避与冲刺，远离危险区域吧。"},mt),
    ["40173"]=setmetatable({id=40173,type=7,picture="UI_jiazai_zhandou21",titleNum="3",titleBig="作战指引",title="作战之道",tips="与强大的敌人对战，对于斯露德而言，也是艰难的战斗。选择目标，闪避，攻击，使用需求，乃至最终运用极奏，才能取得最终的胜利。请直面挑战。收集材料，兑换"},mt),
