    ["473204"]=setmetatable({id=473204,type=7,picture="UI_bg_C_jiaowaiyewan",titleNum="DP 4-4",titleBig="进化之末",title="挑战关卡",tips="通过挑战任务，提升战斗技巧。"},mt),
    ["461101"]=setmetatable({id=461101,type=3,picture="UI_bg_C_jiaowaiyewan",titleNum="Br-1",titleBig="间奏",title="雷元素过载 - 感电",tips="斯露德对敌方异生体造成雷元素过载时，敌方异生体将进入【感电】状态，持续时间10秒。\n感电状态下，受到任意雷元素伤害时，都会从自身发射等量伤害的【闪电链】。\n闪电链最多电击4个目标，每次弹射伤害递减15%。"},mt),
    ["461102"]=setmetatable({id=461102,type=3,picture="UI_bg_C_jiaowaiyewan",titleNum="Br-2",titleBig="间奏",title="火元素过载 - 灼烧",tips="斯露德对敌方异生体造成火元素过载时，敌方异生体将进入【灼烧】状态，持续时间10秒。\n灼烧状态下每0.5秒造成队内所有火元素斯露德总攻击力3%的伤害。\n灼烧状态下可持续累计灼烧印记层数,最高累计10层，每层灼烧印记会提高20%的灼烧伤害。"},mt),
    ["461103"]=setmetatable({id=461103,type=3,picture="UI_bg_C_jiaowaiyewan",titleNum="Br-3",titleBig="间奏",title="冰元素过载 - 冻结",tips="斯露德对敌方异生体造成冰元素过载时，敌方异生体将进入【冻结】状态，持续时间3秒。\n当敌方处于冻结状态时将无法行动或攻击。"},mt),
    ["461104"]=setmetatable({id=461104,type=3,picture="UI_bg_C_jiaowaiyewan",titleNum="Br-4",titleBig="间奏",title="风元素过载 - 风缠",tips="斯露德对敌方异生体造成风元素过载时，敌方异生体将进入【风缠】状态，持续时间10秒。\n进入风缠状态时，会向周围扩散，使附近的敌方也进入风缠状态。\n风缠状态的目标死亡时，会产生一次8.28%范围伤害（基于风元素最高攻击力的一定百分比）同时产生一个体力球为角色回复15%最大体力。"},mt),
    ["50101"]=setmetatable({id=50101,type=3,picture="UI_bg_C01_wendelandebaitian",titleNum="",titleBig="巡检任务",title="脉流巡检 -Ⅰ",tips="部分具备智能的异生体会沿着源能脉络进行移动，这类高智能异生体通常也更危险，而人类的重要城市枢纽为了确保“帆”的稳定运作，选址通常位于源能脉络干流附近..."},mt),
